
<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>特定技能 応募フォーム</title>
  <style>
    body {
      font-family: sans-serif;
      margin: 20px;
    }
    h1 {
      text-align: center;
    }
    .section {
      margin-bottom: 20px;
    }
    label {
      display: block;
      margin: 8px 0 4px;
    }
    input[type="text"], input[type="date"], input[type="number"], textarea, select {
      width: 100%;
      padding: 8px;
      margin-bottom: 10px;
    }
    .job-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(160px, 1fr));
      gap: 15px;
    }
    .job-option {
      border: 1px solid #ccc;
      padding: 10px;
      text-align: center;
      border-radius: 5px;
      background: #f9f9f9;
    }
    .job-option img {
      max-width: 100px;
      height: auto;
      display: block;
      margin: 0 auto 5px;
    }
  </style>
</head>
<body>
  <h1>特定技能 応募フォーム</h1>

  <form>
    <label for="photo">顔写真アップロード：</label><br>
    <input type="file" id="photo" name="photo" accept="image/*"><br><br>
    
    <div class="section">
      <label>氏名</label>
      <input type="text" name="name" required />

      <label>生年月日</label>
      <input type="date" name="birthday" />

      <label>在留資格</label>
      <input type="text" name="visa_status" />

      <label>在留期限</label>
      <input type="date" name="visa_expiry" />

      <label>母国での学歴</label>
      <input type="text" name="education" />

      <label>職歴</label>
      <input type="text" name="experience" />

      <label>（留学生の場合）アルバイト歴</label>
      <input type="text" name="parttime" />

      <label>日本語資格</label>
      <select name="japanese_level">
        <option value="">選択してください</option>
        <option value="N1">N1</option>
        <option value="N2">N2</option>
        <option value="N3">N3</option>
        <option value="N4">N4</option>
      </select>

      <label>所持資格（運転免許など）</label>
      <input type="text" name="licenses" />
    </div>

    <div class="section">
      <label>希望勤務地</label>
      <select name="location">
        <option value="">選択してください</option>
        <option value="首都圏">首都圏</option>
        <option value="その他地域">その他地域</option>
      </select>

      <label>希望月収（円）</label>
      <input type="number" name="salary" />

      <label>通勤時間の上限（分）</label>
      <input type="number" name="commute_time" />
    </div>

    <div class="section">
      <label>志望動機</label>
      <textarea name="motivation" rows="4"></textarea>
    </div>

    <div class="section">
      <label>希望職種（複数選択可）</label>
      <div class="job-grid">
        <div class="job-option">
          <input type="checkbox" name="job" value="漁業" />
